import React from 'react';
import SocialItem from './SocialItem';


function Social() {
    return (
        <div className='list-group'>
            <SocialItem 
                media = 'Facebook' 
                id = 'facebook'
            />
            <SocialItem
                media = 'Youtube' 
                id = 'youtube' 
            />
            <SocialItem media = 'Instagram' id = 'instagram' />
        </div>
    );
};

export default Social;
